                var result = new List<ContentIntegrate>
                {
                    new ContentIntegrate { Id = 0, Name = "Code", NavigatePath = "/code/", TitleHtml = "<i class=\"fas fa-code-branch\"></i> Code", TitleLong = null, TextMd = "# Code Examples\nGet started with the following simple code examples:\n* [Hello World Text](#hello-world-text) (Show simple hello world text)\n* [Data Grid](#data-grid) (Add sql server data grid to web application)\n* [Data Annotation](#data-annotation) (Green arrow up for positive numbers)\n* [Data Lookup Window](#data-lookup-window) (Data lookup up or autocomplete window)", TextHtml = "<h1>Code Examples</h1><p>Get started with the following simple code examples:</p><ul><li><a href=\"#hello-world-text\">Hello World Text</a> (Show simple hello world text)</li><li><a href=\"#data-grid\">Data Grid</a> (Add sql server data grid to web application)</li><li><a href=\"#data-annotation\">Data Annotation</a> (Green arrow up for positive numbers)</li><li><a href=\"#data-lookup-window\">Data Lookup Window</a> (Data lookup up or autocomplete window)</li></ul>", Sort = 3, IdName = "Code" },
                    new ContentIntegrate { Id = 0, Name = "Home", NavigatePath = "/", TitleHtml = "<i class=\"fas fa-home\"></i> Home", TitleLong = "Business Application Framework", TextMd = "# Web Application Framework\nWorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:\n\n![](assets/ScreenCast.gif)\n\n* Data grids (high performance with millions of records and hundreds of columns)\n* Paging (horizontal and vertical), sorting, filtering\n* Lookup window and autocomplete function\n* Master detail relations\n* Modern looking browser web front end (desktop and mobile)\n* Menu Navigation\n* Data access to SQL server and/or memory\n* Multilanguage support\n* Configuration\n\nIt standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:\n\n* ASP.NET Core 5.0\n* Bootstrap 4 and/or Bulma\n* Angular 11 (Also server side rendering for high performance first page load)\n* SQL Server\n\nAllow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.\n\nDeliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with\n\n* [Travis CI](https://travis-ci.org/)\n* [GitHub Actions](https://github.com/features/actions)\n* [Azure Pipelines](https://azure.microsoft.com/en-us/services/devops/pipelines/)\n\n# Live Example\nSee a live example: [https://demo.WorkplaceX.org](https://demo.workplacex.org)\n\n## GitHub\nOr download the source code from GitHub: **[ApplicationDemo](https://github.com/WorkplaceX/ApplicationDemo)** \n\nAdditionally, WorkplaceX business applications run also embedded in SharePoint or on any already existing company web page by just adding a few lines of html code.\n\n", TextHtml = "<h1>Web Application Framework</h1><p>WorkplaceX is an open source framework to simplify business application development. It provides the following features “out of the box”:</p><p></p><img src=\"assets/ScreenCast.gif\" alt=\"assets/ScreenCast.gif\" /><p></p><ul><li>Data grids (high performance with millions of records and hundreds of columns)</li><li>Paging (horizontal and vertical), sorting, filtering</li><li>Lookup window and autocomplete function</li><li>Master detail relations</li><li>Modern looking browser web front end (desktop and mobile)</li><li>Menu Navigation</li><li>Data access to SQL server and/or memory</li><li>Multilanguage support</li><li>Configuration</li></ul><p>It standardizes and simplifies the process of building enterprise business applications on top of existing SQL Server Databases. It can be hosted on premise or in the cloud and is based on the following products:</p><p></p><ul><li>ASP.NET Core 5.0</li><li>Bootstrap 4 and/or Bulma</li><li>Angular 11 (Also server side rendering for high performance first page load)</li><li>SQL Server</li></ul><p>Allow thousands of users to access and manage your companies data in a controlled manner. Be flexible and evolve business models as the marked changes.</p><p>Deliver complex web applications, without having to touch Html or JavaScript when adding new sql columns, tables or views. The framework fully supports continuous integration and delivery (CI/CD) and seamlessly integrates with</p><p></p><ul><li><a href=\"https://travis-ci.org/\">Travis CI</a></li><li><a href=\"https://github.com/features/actions\">GitHub Actions</a></li><li><a href=\"https://azure.microsoft.com/en-us/services/devops/pipelines/\">Azure Pipelines</a></li></ul><p></p><h1>Live Example</h1><p>See a live example: <a href=\"https://demo.workplacex.org\">https://demo.WorkplaceX.org</a></p><p></p><h1>GitHub</h1><p>Or download the source code 