                    new ContentIntegrate { Id = 0, Name = "Install", NavigatePath = "/install/", TitleHtml = "<i class=\"fas fa-desktop\"></i> Install", TitleLong = "Install the Application Framework from Scratch", TextMd = "# Getting Started\nWeb [Application Demo](https://github.com/WorkplaceX/ApplicationDemo) is a comprehensive example to get started with. The following two components need to be installed on the machine as prerequisite:\n* [Node.js](https://nodejs.org/en/) (LTS Version)\n* [.NET Core](https://dotnet.microsoft.com/download) (Version 5.0)\n\n## Git Clone\n```cmd\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n```\nArgument \"--Recursive\" clones also necessary submodule \"Framework\".\n\n## Command Line Interface (CLI)\nThe framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.\n```cmd\ncd ApplicationDemo\n.\\cli.cmd\n```\nAll available framework CLI commands are listed like this:\n", TextHtml = "<h1>Getting Started</h1><p>Web <a href=\"https://github.com/WorkplaceX/ApplicationDemo\">Application Demo</a> is a comprehensive example to get started with. The following two components need to be installed on the machine as prerequisite:</p><ul><li><a href=\"https://nodejs.org/en/\">Node.js</a> (LTS Version)</li><li><a href=\"https://dotnet.microsoft.com/download\">.NET Core</a> (Version 5.0)</li></ul><p></p><h1>Git Clone</h1><p></p><pre><code class=\"language-cmd\">\ngit clone https://github.com/WorkplaceX/ApplicationDemo.git --recursive\n</code></pre><p>Argument \"--Recursive\" clones also necessary submodule \"Framework\".</p><p></p><h1>Command Line Interface (CLI)</h1><p>The framework provides a command line interface (CLI) with all necessary functions like build, deploy and so on. In the root folder type cli.</p><pre><code class=\"language-cmd\">\ncd ApplicationDemo\n.\\cli.cmd\n</code></pre><p>All available framework CLI commands are listed 